import React, { Component } from 'react';

export function getSmiley(message) {
	var msg = replaceEmoticons(message);//message.replace(/:\)/, "$$HAPPY_SMILY$$");
	//msg = message.replace(/;\\)/, "$$HAPPY_WINK_SMILY$$");
	// msg = message.replace(/:(/, "$$SAD_WINK_SMILY$$");
	// msg = message.replace(/:(/, "$$_SAD_WINK_SMILY$$");
	return msg;
}


function RegExpEscape(text) {
    return text.replace(/[-[\]{}()*+?.,\\^$|#\s]/g, "\\$&"); 
}

function replaceEmoticons(text) {   
    var emoticons = {
        ':)'         : 'data:image/png;base64,',
        ':('         : 'data:image/png;base64,',
        ';)'         : 'data:image/png;base64,',
        '<3'         : 'data:image/png;base64,',
        '(love)'     : 'data:image/png;base64,',
        '(kiss)'     : 'data:image/png;base64,',
        '(lips)'     : 'data:image/png;base64,',
        '(cry)'      : 'data:image/png;base64,',
        '(laugh)'    : 'data:image/png;base64,',
        '(angry)'    : 'data:image/png;base64,',
        '(ghost)'    : 'data:image/png;base64,',
        '(sush)'     : 'data:image/png;base64,',
        '(thinking)' : 'data:image/png;base64,',
        '(sick)'     : 'data:image/png;base64,',
        '(cool)'     : 'data:image/png;base64,',
        '(highfive)' : 'data:image/png;base64,',
        '(like)'     : 'data:image/png;base64,',
        '(dislike)'  : 'data:image/png;base64,',
        '(clap)'     : 'data:image/png;base64,',
        '(handshake)': 'data:image/png;base64,',
        '(request)'  : 'data:image/png;base64,',
        '(facepalmm)': 'data:image/png;base64,',
        '(facepalmf)': 'data:image/png;base64,',
        '(dancem)'   : 'data:image/png;base64,',
        '(dancef)'   : 'data:image/png;base64,'

    }

    var result = text;
    var emotcode;
    var regex;

    for (emotcode in emoticons)
    {
        regex = new RegExp(RegExpEscape(emotcode), 'gi');
        result = result.replace(regex, function(match) {
            var pic = emoticons[match.toLowerCase()];

            if (pic != undefined) {
                return '<img class="smiley" src="' + pic + '"/>';
                    } else {
                return match;
                    }
                });
    }

    return result;    
}
export default getSmiley;